import React from 'react'

const InputField = () => {
    return (
        <div className = "inputSection">
            <form method="POST">
                <textarea cols="60" rows="5" placeholder="Enter message here........" />
                <button type="submit">Send</button>
            </form>
        </div>
    )
}

export default InputField
